/// \ingroup libusb_desc
/// A structure representing the standard USB device descriptor. This
/// descriptor is documented in section 9.6.1 of the USB 3.0 specification.
/// All multiple-byte fields are represented in host-endian format.
final class libusb_device_descriptor extends ffi.Struct {
  /// Size of this descriptor (in bytes)
  @ffi.Uint8()
  external int bLength;

  /// Descriptor type. Will have value
  /// \ref libusb_descriptor_type::LIBUSB_DT_DEVICE LIBUSB_DT_DEVICE in this
  /// context.
  @ffi.Uint8()
  external int bDescriptorType;

  /// USB specification release number in binary-coded decimal. A value of
  /// 0x0200 indicates USB 2.0, 0x0110 indicates USB 1.1, etc.
  @ffi.Uint16()
  external int bcdUSB;

  /// USB-IF class code for the device. See \ref libusb_class_code.
  @ffi.Uint8()
  external int bDeviceClass;

  /// USB-IF subclass code for the device, qualified by the bDeviceClass
  /// value
  @ffi.Uint8()
  external int bDeviceSubClass;

  /// USB-IF protocol code for the device, qualified by the bDeviceClass and
  /// bDeviceSubClass values
  @ffi.Uint8()
  external int bDeviceProtocol;

  /// Maximum packet size for endpoint 0
  @ffi.Uint8()
  external int bMaxPacketSize0;

  /// USB-IF vendor ID
  @ffi.Uint16()
  external int idVendor;

  /// USB-IF product ID
  @ffi.Uint16()
  external int idProduct;

  /// Device release number in binary-coded decimal
  @ffi.Uint16()
  external int bcdDevice;

  /// Index of string descriptor describing manufacturer
  @ffi.Uint8()
  external int iManufacturer;

  /// Index of string descriptor describing product
  @ffi.Uint8()
  external int iProduct;

  /// Index of string descriptor containing device serial number
  @ffi.Uint8()
  external int iSerialNumber;

  /// Number of possible configurations
  @ffi.Uint8()
  external int bNumConfigurations;
}

/// \ingroup libusb_desc
/// A structure representing the standard USB endpoint descriptor. This
/// descriptor is documented in section 9.6.6 of the USB 3.0 specification.
/// All multiple-byte fields are represented in host-endian format.
final class libusb_endpoint_descriptor extends ffi.Struct {
  /// Size of this descriptor (in bytes)
  @ffi.Uint8()
  external int bLength;

  /// Descriptor type. Will have value
  /// \ref libusb_descriptor_type::LIBUSB_DT_ENDPOINT LIBUSB_DT_ENDPOINT in
  /// this context.
  @ffi.Uint8()
  external int bDescriptorType;

  /// The address of the endpoint described by this descriptor. Bits 0:3 are
  /// the endpoint number. Bits 4:6 are reserved. Bit 7 indicates direction,
  /// see \ref libusb_endpoint_direction.
  @ffi.Uint8()
  external int bEndpointAddress;

  /// Attributes which apply to the endpoint when it is configured using
  /// the bConfigurationValue. Bits 0:1 determine the transfer type and
  /// correspond to \ref libusb_endpoint_transfer_type. Bits 2:3 are only used
  /// for isochronous endpoints and correspond to \ref libusb_iso_sync_type.
  /// Bits 4:5 are also only used for isochronous endpoints and correspond to
  /// \ref libusb_iso_usage_type. Bits 6:7 are reserved.
  @ffi.Uint8()
  external int bmAttributes;

  /// Maximum packet size this endpoint is capable of sending/receiving.
  @ffi.Uint16()
  external int wMaxPacketSize;

  /// Interval for polling endpoint for data transfers.
  @ffi.Uint8()
  external int bInterval;

  /// For audio devices only: the rate at which synchronization feedback
  /// is provided.
  @ffi.Uint8()
  external int bRefresh;

  /// For audio devices only: the address if the synch endpoint
  @ffi.Uint8()
  external int bSynchAddress;

  /// Extra descriptors. If libusb encounters unknown endpoint descriptors,
  /// it will store them here, should you wish to parse them.
  external ffi.Pointer<ffi.UnsignedChar> extra;

  /// Length of the extra descriptors, in bytes. Must be non-negative.
  @ffi.Int()
  external int extra_length;
}

/// \ingroup libusb_desc
/// A structure representing the standard USB interface association descriptor.
/// This descriptor is documented in section 9.6.4 of the USB 3.0 specification.
/// All multiple-byte fields are represented in host-endian format.
final class libusb_interface_association_descriptor extends ffi.Struct {
  /// Size of this descriptor (in bytes)
  @ffi.Uint8()
  external int bLength;

  /// Descriptor type. Will have value
  /// \ref libusb_descriptor_type::LIBUSB_DT_INTERFACE_ASSOCIATION
  /// LIBUSB_DT_INTERFACE_ASSOCIATION in this context.
  @ffi.Uint8()
  external int bDescriptorType;

  /// Interface number of the first interface that is associated
  /// with this function
  @ffi.Uint8()
  external int bFirstInterface;

  /// Number of contiguous interfaces that are associated with
  /// this function
  @ffi.Uint8()
  external int bInterfaceCount;

  /// USB-IF class code for this function.
  /// A value of zero is not allowed in this descriptor.
  /// If this field is 0xff, the function class is vendor-specific.
  /// All other values are reserved for assignment by the USB-IF.
  @ffi.Uint8()
  external int bFunctionClass;

  /// USB-IF subclass code for this function.
  /// If this field is not set to 0xff, all values are reserved
  /// for assignment by the USB-IF
  @ffi.Uint8()
  external int bFunctionSubClass;

  /// USB-IF protocol code for this function.
  /// These codes are qualified by the values of the bFunctionClass
  /// and bFunctionSubClass fields.
  @ffi.Uint8()
  external int bFunctionProtocol;

  /// Index of string descriptor describing this function
  @ffi.Uint8()
  external int iFunction;
}

