/// \ingroup libusb_dev
/// Speed codes. Indicates the speed at which the device is operating.
enum libusb_speed {
  /// The OS doesn't report or know the device speed.
  LIBUSB_SPEED_UNKNOWN(0),

  /// The device is operating at low speed (1.5MBit/s).
  LIBUSB_SPEED_LOW(1),

  /// The device is operating at full speed (12MBit/s).
  LIBUSB_SPEED_FULL(2),

  /// The device is operating at high speed (480MBit/s).
  LIBUSB_SPEED_HIGH(3),

  /// The device is operating at super speed (5000MBit/s).
  LIBUSB_SPEED_SUPER(4),

  /// The device is operating at super speed plus (10000MBit/s).
  LIBUSB_SPEED_SUPER_PLUS(5);

  final int value;
  const libusb_speed(this.value);

  static libusb_speed fromValue(int value) => switch (value) {
        0 => LIBUSB_SPEED_UNKNOWN,
        1 => LIBUSB_SPEED_LOW,
        2 => LIBUSB_SPEED_FULL,
        3 => LIBUSB_SPEED_HIGH,
        4 => LIBUSB_SPEED_SUPER,
        5 => LIBUSB_SPEED_SUPER_PLUS,
        _ => throw ArgumentError("Unknown value for libusb_speed: $value"),
      };
}

/// \ingroup libusb_misc
/// Error codes. Most libusb functions return 0 on success or one of these
/// codes on failure.
/// You can call libusb_error_name() to retrieve a string representation of an
/// error code or libusb_strerror() to get an end-user suitable description of
/// an error code.
enum libusb_error {
  /// Success (no error)
  LIBUSB_SUCCESS(0),

  /// Input/output error
  LIBUSB_ERROR_IO(-1),

  /// Invalid parameter
  LIBUSB_ERROR_INVALID_PARAM(-2),

  /// Access denied (insufficient permissions)
  LIBUSB_ERROR_ACCESS(-3),

  /// No such device (it may have been disconnected)
  LIBUSB_ERROR_NO_DEVICE(-4),

  /// Entity not found
  LIBUSB_ERROR_NOT_FOUND(-5),

  /// Resource busy
  LIBUSB_ERROR_BUSY(-6),

  /// Operation timed out
  LIBUSB_ERROR_TIMEOUT(-7),

  /// Overflow
  LIBUSB_ERROR_OVERFLOW(-8),

  /// Pipe error
  LIBUSB_ERROR_PIPE(-9),

  /// System call interrupted (perhaps due to signal)
  LIBUSB_ERROR_INTERRUPTED(-10),

  /// Insufficient memory
  LIBUSB_ERROR_NO_MEM(-11),

  /// Operation not supported or unimplemented on this platform
  LIBUSB_ERROR_NOT_SUPPORTED(-12),

  /// Other error
  LIBUSB_ERROR_OTHER(-99);

  final int value;
  const libusb_error(this.value);

  static libusb_error fromValue(int value) => switch (value) {
        0 => LIBUSB_SUCCESS,
        -1 => LIBUSB_ERROR_IO,
        -2 => LIBUSB_ERROR_INVALID_PARAM,
        -3 => LIBUSB_ERROR_ACCESS,
        -4 => LIBUSB_ERROR_NO_DEVICE,
        -5 => LIBUSB_ERROR_NOT_FOUND,
        -6 => LIBUSB_ERROR_BUSY,
        -7 => LIBUSB_ERROR_TIMEOUT,
        -8 => LIBUSB_ERROR_OVERFLOW,
        -9 => LIBUSB_ERROR_PIPE,
        -10 => LIBUSB_ERROR_INTERRUPTED,
        -11 => LIBUSB_ERROR_NO_MEM,
        -12 => LIBUSB_ERROR_NOT_SUPPORTED,
        -99 => LIBUSB_ERROR_OTHER,
        _ => throw ArgumentError("Unknown value for libusb_error: $value"),
      };
}

